import { Component } from '@angular/core';
import { FormControl, FormGroup } from '@angular/forms';

@Component({
  selector: 'app-add-feedback',
  templateUrl: './add-feedback.component.html',
  styleUrls: ['./add-feedback.component.scss']
})
export class AddFeedbackComponent {
  form=new FormGroup({
    name:new FormControl('shira'),
    email:new FormControl(''),
Telephone:new FormControl(''),
Comments:new FormControl(''),
  })

  onSubmit() {
    // TODO: Use EventEmitter with form value
    console.warn(this.form.value);
  }
}

<form action="/home" [formGroup]="form" (ngSubmit)="onSubmit()">
    <div id="parent">
    <div class="wrapper">
    <div class="mb-3">
        <label for="pwd" class="form-label">Name:</label>
        <input type="name" class="form-control" id="pwd" placeholder="Enter name"  formControlName="name" required>
      </div>
    <div class="mb-3 mt-3">
      <label for="email" class="form-label">Email:</label>
      <input type="email" class="form-control" id="email" placeholder="Enter email" name="email" formControlName="email">
    </div>
    <div class="mb-3">
        <label for="comment">Comments:</label>
         <textarea class="form-control" rows="5" id="comment" name="text" formControlName="Comments"></textarea>
    </div>
    <div class="mb-3">
        <label for="comment">Telephone:</label>
         <input type="tel" class="form-control" id="Telephone" placeholder="Enter Telephone" name="Telephone" formControlName="Telephone">
    </div>

    <button type="submit" class="btn btn-ligth" [disabled]="!form.valid">send</button>
</div>
</div>
  </form>
